import React from 'react';
import SignedInLinks from './SignedInLinks'
import Navbarstyle from "./Navbarstyle.css";
import {Nav, NavLink, Bars, NavMenu, NavBtn, NavBtnLink} from './NavbarElements';


const Navbar = () => {
    return (
        <>
            <Nav>

                <NavLink to='/'><h1>Varausjärjestelmä</h1></NavLink>
                <Bars />
                <NavMenu>
                    <NavLink to="/Kotisivu" activeStyle>Koti</NavLink>
                    <NavLink to="/Kuvat" activeStyle> Mökki</NavLink>
                    <NavLink to="/Varaus_lomake" activeStyle> Varaus</NavLink>
                    <NavLink to="/Muut" activeStyle> Muut</NavLink>
                </NavMenu>

                <NavBtn>
                    <NavBtnLink to="/Kirjautuminen">Kirjautuminen</NavBtnLink>
                </NavBtn>

            </Nav>
        </>
    );
};



export default Navbar;
